    false,nt"url": null,nt"notes": "NODC accession 0089614 includes physical
    and underway data collected aboard the MELVILLE during cruise MV1006 in the North
    Pacific Ocean from 2010-04-13 to 2010-05-11. These data include CURRENT SPEED -
    EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
    used to collect these data include ADCP and GPS. These data were collected by Kerry
    Key of SCRIPPS INSTITUTION OF OCEANOGRAPHY and SCRIPPS INSTITUTION OF OCEANOGRAPHY
    as part of Serpentinite, Extension and Regional Porosity Experiment across the Nicaraguan
    Trench (SERPENT). The Lamont-Doherty Earth Observatory (LDEO) submitted these data
    to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R) program. The
    ADCP data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
